svg.script:
	function setVisibility(layer,v){
	    var l2= document.getElementById(layer);
	    	l2.setAttribute("visibility",v);
	}


      function drawPath(myPath){
	    var l3= document.getElementById("L3");
            var pathold= document.getElementById("path");
            if(pathold){
                l3.removeChild(pathold);  
            }
            var node=document.createElementNS("http://www.w3.org/2000/svg","path");
            node.setAttribute("id","path")
	    node.setAttribute("fill","none");
	    node.setAttribute("stroke","red");
            node.setAttribute("stroke-miterlimit","10");
	    node.setAttribute("stroke-width","2.5");
	    node.setAttribute("d",myPath);
	    l3.appendChild(node);
	}

      function drawcircle(x,y){
	    var l4= document.getElementById("L4");
            var node=document.createElementNS("http://www.w3.org/2000/svg","circle");
	    node.setAttribute("fill","red");
	    node.setAttribute("stroke","red");
	    node.setAttribute("stroke-miterlimit","10");
	    node.setAttribute("cx",x);
            node.setAttribute("cy",y);
      	    node.setAttribute("r",20);
	    l4.appendChild(node);
	}

      function setPointer(angle,x,y){
	    var l5= document.getElementById("L5");
            l5.setAttribute("transform","rotate("+angle+" "+x+" "+y+")")
            var p= document.getElementById("pnow");
            p.setAttribute("x",x)
            p.setAttribute("y",y)
	}



      function drawDirection(myPath){
	    var l6= document.getElementById("L6");
            var pathold= document.getElementById("path");
            if(pathold){
                l6.removeChild(pathold);  
            }
            var node=document.createElementNS("http://www.w3.org/2000/svg","path");
            node.setAttribute("id","path")
	    node.setAttribute("fill","none");
	    node.setAttribute("stroke","green");
            node.setAttribute("stroke-miterlimit","10");
	    node.setAttribute("stroke-width","30");
	    node.setAttribute("d",myPath);
            node.setAttribute("marker-end","url(#arrow)");
 	    l6.appendChild(node);
	}

      function setAim(x,y){
	    var l7= document.getElementById("L7");
            l7.setAttribute("transform","translate("+x+" "+y+")")
	}


      function setScanResult(x,y){
	    var l8= document.getElementById("L8");
            l8.setAttribute("transform","translate("+x+" "+y+")")
	}
